import React from 'react'

const CenterDivider = ({text}) => {

    return (
        <>
        <Divider sx={{display: {xs: 'none', sm: 'block'}}}>
            <Typography variant='h5' sx={{textTransform: 'uppercase'}}>
                {text}
            </Typography>
        </Divider>

        <Box sx={{display: {xs: 'blcok', sm: 'none'}}} >
            <Divider/>
            <Typography variant='h5' sx={{textTransform: 'uppercase'}}>
                {text}
            </Typography>
            <Divider />
        </Box>
        </>
    )
}

export default CenterDivider
